    public static int paint(int A, int B, ArrayList<Integer> C) {
        ArrayList<Double> wall = new ArrayList<>();
        for (int i = 0; i < C.size(); i++) {
            wall.add(i, (double) C.get(i) *B);
        }
        double start=Collections.max(wall);
        if (A>=wall.size()) return (int) start%10000003;
        double end = 0;
        for (double x :wall){
            end+=x;
        }
        if (A==1) return (int) (end%10000003);
        double ans=0;
        while (start<=end){
            double mid=start+(end-start)/2;
            int i=0;
            double count=0;
            double sum=0;
            while(i<wall.size()){
                sum+=wall.get(i);
                if (sum>mid){
                    count++;
                    sum=wall.get(i);
                }
                i++;
            }
            if (count>=A) start=mid+1;
            else {
                ans=mid;
                end=mid-1;
            }
        }
        if (ans==0) return (int) (Collections.max(wall)%10000003);
        return (int) (ans%10000003);
    }
    public int sqrt(int A) {
        int start=0;
        int end=A;
        while(start<=end){
            int mid=start+(end-start)/2;
            if (mid*mid==A) return mid;
            if(mid*mid<A) start=mid+1;
            else end=mid-1;
        }
        return 0;
    }
    public static int allocateBooks(ArrayList<Integer> A, int B) {
        if(B>A.size()) return -1;
        long start = Collections.max(A);
        long end = 0;
        for (int x:A){
            end+=x;
        }
        if (B==1) return (int) end;
        long ans=0;
        while(start<=end){
            long mid = start+(end-start)/2;
            int i=0;
            int count=0;
            int sum=0;
            while(i<A.size()){
                sum+=A.get(i);
                if (sum>=mid){
                    count++;
                    sum=A.get(i);
                }
                i++;
            }
            if (count<B) end=mid-1;
            else{
               ans=mid;
               start=mid+1;
            }
        }
        return  ans==0? Collections.max(A) : (int)ans;
    }
    public static int aggressiveCows(ArrayList<Integer> A, int B) {
        Collections.sort(A);
        int min=1;
        int max=A.get(A.size()-1)-A.get(0);
        int ans=0;
        while(min<=max){
            int mid=min+(max-min)/2;
            int count=1;
            int i=0;
            int j=1;
            while (j<A.size()){
                if (A.get(j)-A.get(i)>=mid){
                    count++;
                    i=j;
                }
                j++;
            }
            if (count<B){
                max=mid-1;
            }
            else {
                ans=mid;
                min =mid+1;
            }
        }
        return ans;
    }
    static int specialInteger(ArrayList<Integer> A, int B) {
        int start=1;
        int end=A.size();
        int ans=0;
        while(start<=end){
            int mid=start+(end-start)/2;
            long windowSum=0;
            for (int i = 0; i < mid; i++) {
                windowSum+=A.get(i);
                windowSum%=100000007;
            }

            for (int i = mid; i < A.size(); i++) {
                if (windowSum<=B){
                   windowSum+=A.get(i)-A.get(i-mid);
                   windowSum%=100000007;
                }
                else break;
            }
            if (windowSum>B) end=mid-1;
            else {
                ans=mid;
                start=mid+1;
            }
        }
        return ans;
    }
    public static int solveAthMagicalNumber(int A, int B, int C) {
        long start=1L;
        long end=Long.MAX_VALUE;
        int lcm =  B*C/gcd(B,C);
        long ans = 0L;
        while (start<=end){
            long mid = (start + (end-start)/2);
            long terms = (noOfTerms(B,C,lcm,mid));
            if (terms<(long)A) start=(mid+1);
            else {
                ans=mid;
                end=mid-1;
            }
        }
        return (int) (ans%1000000007L);
    }
    static int gcd(int a , int b){
        if (b==0) return a;
        return gcd(b,a%b);
    }
    static long noOfTerms(int a, int b, int lcm, long num){
        return num/a + num/b - num/lcm;
    }


    public static String solveSmallestGoodBase(String A) {
        // constraint 3 <= A <= 10^18,
        // if A=3 base is 2 for "1"
        // if A=10^18 base is 2 then answer will have max 60 digits
        // A can be converted to all 1s if
        // n= 1 + base^1 + base^2 + base^3 + ... base^i  -> i will range from 2 to 60
        // sum of GP = n = (b^i-1)/(b-1)
        //goodbase b where n(b-1)==b^i-1
        int min=1;
        int max= (int) Math.ceil(Math.log(1e18)/Math.log(2));
        long num=Long.parseLong(A);
        for (int  i = max; i >=min ; i--) {
            long start=2L;
            long end=num;
            while(start<=end){
                long mid = start + (end-start)/2L;
                double LHS = num * (mid-1);
                double RHS = (Math.pow(mid,i)-1);
                if (LHS==RHS) return mid+"";
                if (LHS<RHS) end=mid-1;
                else start=mid+1;
            }
        }
        return Long.parseLong(A)-1L+"";
    }

    public static int searchMatrix(ArrayList<ArrayList<Integer>> A, int B) {
        for (ArrayList<Integer> list : A){
            if (list.get(0)<=B&&list.get(list.size()-1)>=B){
                int start=0;
                int end=list.size()-1;
                while (start<=end){
                    int mid= start+ (end-start)/2;
                    if (list.get(mid).equals(B)) return 1;
                    if (list.get(mid)<B) start=mid+1;
                    else end=mid-1;
                }
            }
        }
        return 0;
    }
    public static int findMedian(ArrayList<ArrayList<Integer>> A) {
        int min = Integer.MAX_VALUE;
        for (ArrayList<Integer> list : A) {
            min = Math.min(min, list.get(0));
        }
        int max = Integer.MIN_VALUE;
        for (ArrayList<Integer> list : A) {
            max = Math.max(max, list.get(list.size()-1));
        }
        return findMedianOfMatrix(A,min,max);
    }
    public static int findMedianOfMatrix(ArrayList<ArrayList<Integer>> A,int start, int end){
        int mid = start + (end-start)/2;
        int elementsLessThanMid = 0;
        for (ArrayList<Integer> list : A){
            elementsLessThanMid+=elementsLessThan(list,mid,0,list.size()-1);
        }
        int elementsGreaterThanMid = 0;
        for (ArrayList<Integer> list : A){
            elementsGreaterThanMid+=elementsGreaterThan(list,mid,0,list.size()-1);
        }
        if (elementsGreaterThanMid==elementsLessThanMid) return mid;
        else if (elementsGreaterThanMid>elementsLessThanMid){
            return findMedianOfMatrix(A,mid+1,end);
        }
        else {
            return findMedianOfMatrix(A,start,mid-1);
        }
    }
    public static int elementsLessThan(ArrayList<Integer> A, int k, int start, int end){
        if (k<=A.get(start)) return 0;
        if (k>A.get(end)) return A.size();
        int count=0;
        while(start<=end){
            int mid = start+(end-start)/2;
            if (A.get(mid)<k){
                count=mid+1;
                start=mid+1;
            }
            else end=mid-1;
        }
        return count;
    }
    public static int elementsGreaterThan(ArrayList<Integer> A, int k, int start, int end){
        if (k>=A.get(end)) return 0;
        if (k<A.get(start)) return A.size();
        int count=0;
        while (start<=end){
            int mid=start+(end-start)/2;
            if (A.get(mid)>k){
                count=mid;
                end=mid-1;
            }
            else start=mid+1;
        }
        return A.size()-count;
    }
